import{Tabs,H2,Table} from 'govuk-react';
import { useNavigate } from 'react-router-dom';

import { Routes, Route } from "react-router-dom";
import DRTab from './De-Register/DRTab';
import BookTab from './BookAppointment/BookTab';
import ViewTab from './ViewAppointment/ViewTab';
import DoctorTab from './DoctorsAvailable/DoctorTab';

function GPTabs(){
     
    const navigate = useNavigate();
return(
  <div>
  
      <Routes>
        <Route path="/Doctors-available" element={<DoctorTab />} />
        <Route path="/BookTab" element={<BookTab />} />
        <Route path="/View-or-cancel-appointments" element={<ViewTab />} />
        <Route path="/De-register" element={<DRTab />} />
      </Routes>

    <Tabs>
        <Tabs.Title>
            Contents
        </Tabs.Title>
  <Tabs.List>
    <Tabs.Tab onClick={() => navigate("/Doctors-available")} selected>
      Doctors at GP
    </Tabs.Tab>
    <Tabs.Tab onClick={() => navigate("/BookTab")}>
      Book Appointment
    </Tabs.Tab>
    <Tabs.Tab onClick={() => navigate("/View-or-cancel-appointments")}>
      View/Cancel Appointment
    </Tabs.Tab>
    <Tabs.Tab onClick={() => navigate("/De-register")}>
      De-Register
    </Tabs.Tab>
  </Tabs.List>
 
  <DoctorTab />
  
  <BookTab />

  <ViewTab />

  <DRTab />

</Tabs>

</div>

)};

export default GPTabs;
